    private string FormatMoney(BigInteger value)
   {
    BigInteger[] divisors = {
        BigInteger.Pow(10, 3),
        BigInteger.Pow(10, 6),
        BigInteger.Pow(10, 9),
        BigInteger.Pow(10, 12),
        BigInteger.Pow(10, 15),
        BigInteger.Pow(10, 18),
        BigInteger.Pow(10, 21),
        BigInteger.Pow(10, 24),
        BigInteger.Pow(10, 27),
        BigInteger.Pow(10, 30),
        BigInteger.Pow(10, 33),
        BigInteger.Pow(10, 36),
        BigInteger.Pow(10, 39),
        BigInteger.Pow(10, 42),
        BigInteger.Pow(10, 45),
        BigInteger.Pow(10, 48),
        BigInteger.Pow(10, 52),};
        string[] suffixes = { "K", "M", "B", "T", "aa", "ab","ac", "ad", "ae", "af", "ag", "ah", "ai", "aj", "ak", "al",};

        if (value < 1000)
        {
            return value.ToString();
        }

        for (int i = 0; i < divisors.Length; i++)
        {
            if (value < divisors[i] * 1000)
            {
                float formattedValue = (float)value / (float)divisors[i];
                return $"{formattedValue:F1}{suffixes[i]}";
            }
        }

        int lastIndex = divisors.Length - 1;
        float finalFormattedValue = (float)value / (float)divisors[lastIndex];
        return $"{finalFormattedValue:F1}{suffixes[lastIndex]}";
    }



    
