                result = if (invert!!) -1 * result else result
            }
        }
        class Multiply: Subcommand("mul", "Multiply") {
            val numbers by argument(ArgType.Int, description = "Addendums").vararg()
            var result: Int = 0

            override fun execute() {
                result = numbers.reduce{ acc, it -> acc * it }
            }
        }
        val summary = Summary()
        val multiple = Multiply()
        class Run : Subcommand("run", "Run a simulation or a batch of simulations") {

            val simulationFile by parser.argument(
                ArgType.String,
                "simulation file",
                """
                Simulation file to be executed.
                """.trimIndent(),
            )

            override fun execute() {
                println(simulationFile)
            }
        }
        parser.subcommands(Run())
        parser.parse(args)
    }
}

