#include <iostream>
#include <fstream>
#define DIM 101
using namespace std;

ifstream fin("date.in.txt");
ofstream fout("date.out.txt");

int n, a[DIM][DIM];

int functieb(int n, int a[DIM][DIM])//dim reprezinta valloarea maxima pe care o poate lua n
{
    ///in vectorul p, p[i] va retine numarul de valori nenule din submatrice determinata de i linii si i coloane
    int p[DIM + 1], elem;

    ///initializam vectorul p cu 0
    for (int i = 1; i <= n; i++)
        p[i] = 0;
    for (int i = 1; i <= n; i++)
        for (int j = 1; j <= n; j++)
            if (a[i][j] != 0)
                p[max(i, j)]++;
    for (int i = 3; i <= n; i++)
        p[i] = p[i - 1] + p[i];

    //verificam conditia i)
    for (int i = 2; i <= n; i++)
        if (p[i] != 2 * i - 2)
            return 0;

    //verificam conditia ii
    for (int j = 1; j <= n; j++)
        for (int i = j; i <= n; i++)
            if ((a[i][j] != 0 or a[j][i] != 0) and (a[i][j] != a[j][i] + 1))
                return 0;

    //verificam codnitia iii)
    for (int i = 1; i <= n; i++)
    {
        elem = 0;
        for (int j = 1; j <= n; j++)
            if (a[i][j] != 0 and elem == 0)
                elem = a[i][j];
            else if (a[i][j] != 0 and a[i][j] != elem)
                return 0;
    }
    return 1;
}

void functiec(int n, int a[DIM][DIM])
{
    int t[DIM + 1] = { 0 }, maxx = 0, x=0;
    t[1] = 0;
    for(int j=1; j<n; j++)
        for(int i=j+1; i<=n; i++)
            if (a[i][j] != 0)
            {
                t[i] = j;
                if (a[i][j] > maxx)
                    maxx = a[i][j], x = i;//x reprezinta nodul cel mai indepartat de radacina
            }
    while (t[x] != 0)
    {
        fout << x << " ," << " ";
        x = t[x];
    }
    fout << 1;
}

int main()
{
    fin >> n;
    for (int i = 1; i <= n; i++)
        for (int j = 1; j <= n; j++)
            fin >> a[i][j];
    fout << functieb(n, a);
    fout << endl;
    functiec(n, a);
    return 0;
}

